return(
    <div className="container">
    <div className="row">
      <div className="col-md-12">
        <h3>Home page</h3>
      </div>
      <table className="table table-bordered table-striped text-center" border="1">
<thead>
          <tr>
            <th>First Name</th>
            <th>Email</th>
            <th>Details</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item._id}>
              <td>{item.first_name}{item.last_name}</td>
              <td>{item.email}</td>
              <td>
                <button className="btn btn-primary" onClick={() => navigate(`/detail`)}>Details</button>
              </td>
            </tr>
          ))}
        </tbody> 
      </table>
    </div>
    </div>
)
};
